#version 100

#ifdef GL_FRAGMENT_PRECISION_HIGH
    precision highp float;
#else
    precision mediump float;
#endif
precision highp int;
uniform 	vec4 _Fade;
uniform 	mediump vec4 _Color;
varying highp vec2 vs_TEXCOORD0;
#define SV_Target0 gl_FragData[0]
vec2 u_xlat0;
bvec4 u_xlatb1;
mediump float u_xlat16_2;
vec2 u_xlat6;
bvec2 u_xlatb6;
void main()
{
    u_xlat0.xy = vs_TEXCOORD0.xy + (-_Fade.xz);
    u_xlat6.xy = (-_Fade.xz) + _Fade.yw;
    u_xlat0.xy = u_xlat0.xy / u_xlat6.xy;
    u_xlat0.xy = clamp(u_xlat0.xy, 0.0, 1.0);
    u_xlat0.x = u_xlat0.x * _Color.w;
    u_xlatb1 = notEqual(_Fade, vec4(0.0, 0.0, 0.0, 0.0));
    {
        bvec2 hlslcc_orTemp = u_xlatb6;
        hlslcc_orTemp.x = u_xlatb1.y || u_xlatb1.x;
        hlslcc_orTemp.y = u_xlatb1.w || u_xlatb1.z;
        u_xlatb6 = hlslcc_orTemp;
    }
    u_xlat16_2 = (u_xlatb6.x) ? u_xlat0.x : _Color.w;
    u_xlat0.x = u_xlat0.y * u_xlat16_2;
    SV_Target0.w = (u_xlatb6.y) ? u_xlat0.x : u_xlat16_2;
    SV_Target0.xyz = _Color.xyz;
    return;
}

